INSERT INTO `noticias` (`noticia_id`, `noticia_titulo`, `noticia_contenido`, `noticia_fecha`, `noticia_cat`, `noticia_autor`) VALUES
(1, 'Servidor Offline', '<p>El Servidor permanecer&aacute; <strong>cerrado hasta el Lunes a las 18:00</strong> vamos a realizar un reset para la correcci&oacute;n de los balances. Entre otros bugs. Las cuentas est&aacute;n des habilitadas para crear la creaci&oacute;n. La web permanecer&aacute; cerrada. El domingo iniciamos con expe y oro f&aacute;cil, tambi&eacute;n el sistema de torneos autom&aacute;ticos y algunas sorpresas mas.</p>\r\n\r\n<p>Gracias por su paciencia!</p>', '2012-03-09 20:50:41', 'Noticias', 'Marius'),
(2, 'Web Online', '<p>La web ya se encuentra online y se pueden volver a crear las cuentas. Se habilito un <strong>sistema de comentarios</strong> en las noticias, que funciona solo para usuarios registrados. Esperamos que les guste.</p>', '2012-03-11 23:35:59', 'Noticias', 'Marius'),
(3, 'Servidor OnLine', '<p>Ya todos podemos volver a disfrutar de InmortalAO. Desde las 18:00 hs que esta online.</p>\r\n\r\n<p>Muchas Gracias por el apoyo</p>', '2012-03-12 21:17:24', 'Noticias', 'Marius'),
(4, 'Sistema de compra de cr&eacute;ditos', '<p>El equipo de desarrollo web puso en marcha el sistema de compra de creditos mediante RapiPago, PagoFacil, BaproPagos, Ripsa y CobroExpress.</p>\r\n\r\n<p>El sistema de SMSs funciona correctamente y aprobechamos para agradecer a todos los que ya compraron creditos mediante SMS.</p>', '2012-03-13 21:49:11', 'Implementaciones', 'Marius'),
(5, 'Sistema de Mini Estad&iacute;sticas web', '<p>Se puso en marcha un sistema que permite a travez de las estadisticas hacer click sobre los personajes y desplegar mas informacion del mismo.</p>\r\n\r\n<p>En un futuro tendremos mas sorpresas para este sistema.</p>', '2012-03-14 19:15:59', 'Implementaciones', 'Marius'),
(6, 'Servidor Online', '<p>El d&iacute;a de hoy se volvio a prender el servidor y con &eacute;l algunas sorpresas.</p>\r\n\r\n<p>* Nuevo sistema de meditaciones para donadores<br />\r\n* Nuevo foro.<br />\r\n* Nueva Wiki.<br />\r\n* Eventos fijos<br />\r\n* Expe y Oro x2<br />\r\n* Torneos Automaticos<br />\r\n* Sms x2<br />\r\n* Solucion de algunos bugs<br />\r\n* Entre otras modificaciones</p>', '2012-03-19 14:19:04', 'Noticias', 'Marius'),
(7, 'Servidor Inestable', '<p>Ya estamos nuevamente online, pero el servidor se encuentra inestable, es probable que caiga nuevamente. Por eso les recomendamos que relogeen cada vez que pasen de level as&iacute; les guardan los cambios y no sufren mucho el rollback.</p>\r\n\r\n<p>Estamos trabajando para solucionar el problema.</p>', '2012-03-22 15:21:04', 'Noticias', 'Marius'),
(8, 'Nuevos objetos a la venta', '<p>El d&iacute;a de hoy se puso a la venta a travez del MercadoAO una lista de coronas. Para que puedan comprarlas.</p>', '2012-03-24 22:18:17', 'Implementaciones', 'Marius'),
(9, 'Servidor On', '<p>El servidor vuelve a estar On-Line para el disfrute de todos. Se aprovecho el tiempo Off-Line para hacer alguna mejoras.</p>', '2012-04-03 14:24:04', 'Noticias', 'Marius'),
(10, 'Servidor en Manetenimiento', '<p>El servidor esta en mantenimiento. Va a estar off-line por unos momentos. Vamos a avisar cuando este On-Line nuevamente.</p>', '2012-04-03 17:35:15', 'Noticias', 'Marius'),
(11, 'Servidor nuevamente On-Line', '<p>Despues del mantenimiento estamos otra vez online, esperamos que ahora todo funcione mejor.</p>', '2012-04-03 20:48:24', 'Noticias', 'Marius'),
(12, 'Reseteo General de Personajes', '<p>Reset General: Hoy se realiz&oacute; un reseteo general del servidor, todos los personajes y clanes fueron borrados.</p>\r\n', '2012-04-13 01:40:49', 'Noticias', 'Marius'),
(13, 'Postulaciones Abiertas', '<p>Postulaciones: Se abrieron las postulaciones, el staff seleccionar&aacute; personas para integrar al Staff de InmortalAO. Las postulaciones son solamente via foro en la seccion Postulaciones. No manden MP o mensajes en Facebook. No seran tomados en cuenta.</p>', '2012-04-13 01:40:49', 'Noticias', 'Marius'),
(14, 'Mejoras en el MercadoAO', '<p>Mejoramos el MercadoAO ahora es mas f&aacute;cil saber que estamos comprando.</p>\r\n\r\n<p>Se agregaron: Manuale de Liderazgo, Manual de Equitacion y Manual de Navegacion. Y se retiraron algunos objetos insecesarios.</p>', '2012-04-13 16:06:37', 'Implementaciones', 'Marius'),
(15, 'Nueva incorporaci&oacute;n al Staff', '<p>Hoy damos la bienvenida al Staff a Enthiruv. Va a desempe&ntilde;ar su labor como Consejero. Sean amables con &eacute;l. Las postulaciones siguen abiertas. Te estamos esperando! Postulate en el foro de la comunidad.</p>', '2012-04-15 02:55:39', 'Staff', 'Marius'),
(16, 'Arenas 1vs1 Abiertas!', '<p>Se abrieron las Arenas, ya todos podemos disfrutar de este nuevo evento automatico. El sistema de Arenas 1vs1 nos permite medir nuestras fuerzas con otros personajes. Los objetos no caen al morir. Para mas informaci&oacute;n ver le seccion <a href="http://inmortalao.com.ar/eventos.php" title="Ver los eventos de InmortalAO">Eventos</a></p>', '2012-04-15 04:46:11', 'Eventos', 'Marius'),
(17, 'Nuevo Consejero', '<p>Una nueva incorporaci&oacute;n al Staff, se une a nosotros Zeta. Va a desempe&ntilde;ar su labor como Consejero. Le deseamos la mejor de las suertes para &eacute;l.</p>\r\n\r\n<p>Recuerdes que seguimos en busca de staff. Post&uacute;late en el Foro de la comunidad.</p>', '2012-04-16 23:50:52', 'Staff', 'Marius'),
(18, 'S&aacute;bado 21 de abril Gran Torneo 1vs1', '<p>El d&iacute;a s&aacute;abado se estara realizando el primer Gran Torneo organizado por Jerek el Rey.</p>\r\n\r\n<ul>\r\n<li>Inscripci&oacute;n: 100k</li>\r\n<li>Clases: Todas</li>\r\n<li>Nivel: Mayor de 26</li>\r\n</ul>\r\n\r\n<p>Premio: 5 Cr&eacute;ditos, 15 d&iacute;as de Donador.</p>\r\n\r\n<p>Ganador del torneo: <strong>Azarela</strong></p>', '2012-04-20 20:54:00', 'Eventos', 'Marius'),
(19, 'Ascensos en el Staff', '<p>Ascensos en el Staff y nuevas incorporaciones: <strong>Zeta</strong> y <strong>Tregar</strong> fueron ascendidos a Semi-Dioses y se incorpor&oacute; al Staff a <strong>Delmar</strong> que se desempe&ntilde;ar&aacute; como Consejero.<p>', '2012-04-26 23:20:53', 'Staff', 'Marius'),
(20, 'Mejoras en el Balance', '<p>Hoy se implement&oacute; un parche de dateo donde se arreglo un sin fin de bugs, se corrigieron gr&aacute;ficos de objetos y se restringieron ciertos objetos a algunas clases especificas como corresponde.</p><p>Pronto tendremos mas implementaciones para mejorar el balance.</p>', '2012-04-30 23:47:12', 'Implementaciones', 'Marius'),
(21, 'Nuevos objetos en el MercadoAO', '<p>Se ha agregado al <strong>MercadoAO</strong> una serie de objetos catalogados como <strong>Vips</strong>, estos objetos de gran valor no pueden ser pasados por correo, tirarlos al suelo, comerciarlos con NPCs o usuarios, no caen al morir y no pueden ser robados.</p>\r\n<ol>\r\n  <li>Casco Infernal</li>\r\n  <li>Casco Imperial</li>\r\n  <li>Casco Ca&oacute;tico</li>\r\n  <li>Escudo de Reflexi&oacute;n (RM +30)</li>\r\n  <li>Casco de Cruzado</li>\r\n  <li>Yelmo de la Resurrecci&oacute;n</li>\r\n  <li>Espada Argentum</li>\r\n</ol>', '2012-05-20 01:21:40', 'Implementaciones', 'Marius'),
(22, 'Campa&ntilde;a de validaci&oacute;n', '<p>El d&iacute;a S&aacute;bado 2 de Junio se le va a acreditar <strong>5 d&iacute;as de donador</strong> a todas las cuentas validadas. Participan todas las cuentas que para ese d&iacute;a est&eacute;n validadas, sean cuentas nuevas o viejas.</p>\r\n\r\n<p><strong>La acreditaci&oacute;n se va a realizar al medio d&iacute;a del S&aacute;bado.</strong></p>', '2012-05-23 14:32:36', 'Noticias', 'Marius'),
(23, 'Nuevas incorporaciones', '<p>Entre el d&iacute;a de ayer y hoy se hicieron las siguientes incorporaciones en el <strong>Staff</strong></p>\r\n<ul>\r\n  <li>Eahumk (Consejero)</li>\r\n  <li>InonQ (Consejero)</li>\r\n  <li>Qinseh (Lider Republicano)</li>\r\n  <li>Asnalem (Lider Ca&oacute;tico)</li>\r\n  <li>Axroanck (Lider Imperial)</li>\r\n</ul>\r\n<p>Las denuncias por anti-facci&oacute;n se realizan v&iacute;a foro en la secci&oacute;n de cada facci&oacute;n.</p>', '2012-05-26 20:31:32', 'Staff', 'Marius'),
(24, 'El Laberinto recargado', '<p>Tenemos el agrado de comunicarles que el d&iacute;a S&aacute;bado 9 de junio se realizar&aacute; un evento "EL LABERINTO RECARGADO".</p>\r\n\r\n<p>Para mas informaci&oacute;n ingresa <a href="http://inmortalao.com.ar/comunidad/showthread.php?tid=793" title="El Laberinto recargado">aqu&iacute;</a>.</p>\r\n\r\n<p><strong>Hay importantes premios para los ganadores.</strong></p>', '2012-06-08 15:56:05', 'Eventos', 'Marius');
